    false,nt"url": null,nt"notes": "This annual narrative report for Benton
    Lake National Wildlife Refuge outlines Refuge accomplishments during the 1999 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, and funding is given. Habitat management is also covered; subjects
    include wetlands, haying, pest control, and water rights. The wildlife section of
    the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, animal control, marking
    and banding, and disease control. The public uses of the Refuge described in this
    report include outdoor classrooms, interpretive programs, hunting, and law enforcement.
    The equipment and facilities section of the report provides information about rehabilitation,
    major maintenance, equipment replacement, communication systems, and computer systems",nt"license_title":
